import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import img1 from "./Pythonimg/python1.jpg";
import img2 from "./Pythonimg/python2.jpg";
import img3 from "./Pythonimg/python3.jpg";
import img4 from "./Pythonimg/python4.jpg";
import img5 from "./Pythonimg/python5.jpg";
import img6 from "./Pythonimg/python6.jpg";
import img7 from "./Pythonimg/python7.jpg";
import img8 from "./Pythonimg/python8.jpg";
import img9 from "./Pythonimg/python9.jpg";
function Python() {
  return (
    <div>
      <Container>
        <Row className="row">
          <Col className="col1" lg={3}>
            <img src={img1} alt="" />
            <img src={img2} alt="" />
            <img src={img3} alt="" />
            <img src={img4} alt="" />
            <img src={img5} alt="" />
            <img src={img6} alt="" />
            <img src={img7} alt="" />
            <img src={img8} alt="" />
            <img src={img9} alt="" />
          </Col>
        </Row>
      </Container>
    </div>
  );
}
export default Python;
